//import logo from './logo.svg';
import './App.css';
import React from 'react'

function App() {
  return (
    <div className="App" style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
      <header style={{ textAlign: 'center', padding: '20px', backgroundColor: '#282c34', color: 'white' }}>
        <h1>Timeline of Events</h1>
      </header>
      <main style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', flexGrow: 1 }}>
        <div style={{ width: '200px', padding: '10px', margin: '10px 0', backgroundColor: '#f0f0f0', border: '1px solid #ccc', borderRadius: '5px', textAlign: 'center' }}>
          Event 1
        </div>
        <div style={{ width: '200px', padding: '10px', margin: '10px 0', backgroundColor: '#f0f0f0', border: '1px solid #ccc', borderRadius: '5px', textAlign: 'center' }}>
          Event 2
        </div>
        <div style={{ width: '200px', padding: '10px', margin: '10px 0', backgroundColor: '#f0f0f0', border: '1px solid #ccc', borderRadius: '5px', textAlign: 'center' }}>
          Event 3
        </div>
        <div style={{ width: '200px', padding: '10px', margin: '10px 0', backgroundColor: '#f0f0f0', border: '1px solid #ccc', borderRadius: '5px', textAlign: 'center' }}>
          Event 4
        </div>
      </main>
    </div>
  );
}

export default App;
